import React, { Component } from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";

const Groomer = () => {
  return (
    <>
      <Component />
    </>
  );
};

Groomer.PropTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default Groomer;
